import React from "react";
import ProductCard from "./ProductCard";
import Container from "react-bootstrap/Container";

const Home = () => {
    return (
        <main>
            <Container className="container products p-5">
                <h2 class="text-center display-2 fw-bold py-2">
                    Our Offerings
                </h2>
                <div class="row g-4 text-center "></div>
            </Container>
        </main>
    );
};

export default Home;
